import React, { useState } from 'react';
import { 
    Box, 
    TextField, 
    Button, 
    Container, 
    Typography,
    MenuItem 
} from '@mui/material';
import api from '../services/api';

const JogadorForm = () => {
    const [formData, setFormData] = useState({
        nome: '',
        email: '',
        senha: '',
        nivel: '',
        localizacao: ''
    });

    const niveis = ['iniciante', 'intermediário', 'avançado'];

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await api.post('/jogadores', formData);
            alert('Jogador cadastrado com sucesso!');
            setFormData({
                nome: '',
                email: '',
                senha: '',
                nivel: '',
                localizacao: ''
            });
        } catch (error) {
            alert('Erro ao cadastrar jogador');
            console.error(error);
        }
    };

    return (
        <Container maxWidth="sm">
            <Box sx={{ mt: 4 }}>
                <Typography variant="h4" gutterBottom>
                    Cadastro de Jogador
                </Typography>
                <form onSubmit={handleSubmit}>
                    <TextField
                        fullWidth
                        label="Nome"
                        name="nome"
                        value={formData.nome}
                        onChange={handleChange}
                        margin="normal"
                        required
                    />
                    <TextField
                        fullWidth
                        label="Email"
                        name="email"
                        type="email"
                        value={formData.email}
                        onChange={handleChange}
                        margin="normal"
                        required
                    />
                    <TextField
                        fullWidth
                        label="Senha"
                        name="senha"
                        type="password"
                        value={formData.senha}
                        onChange={handleChange}
                        margin="normal"
                        required
                    />
                    <TextField
                        fullWidth
                        select
                        label="Nível"
                        name="nivel"
                        value={formData.nivel}
                        onChange={handleChange}
                        margin="normal"
                        required
                    >
                        {niveis.map((nivel) => (
                            <MenuItem key={nivel} value={nivel}>
                                {nivel}
                            </MenuItem>
                        ))}
                    </TextField>
                    <TextField
                        fullWidth
                        label="Localização"
                        name="localizacao"
                        value={formData.localizacao}
                        onChange={handleChange}
                        margin="normal"
                        required
                    />
                    <Button 
                        type="submit" 
                        variant="contained" 
                        color="primary"
                        sx={{ mt: 2 }}
                        fullWidth
                    >
                        Cadastrar
                    </Button>
                </form>
            </Box>
        </Container>
    );
};

export default JogadorForm;
